import os
import pandas as pd
from PIL import Image
import exifread
import tkinter as tk
from tkinter import filedialog, messagebox

import base64
from PIL import Image, ImageTk
from io import BytesIO

def carregar_metadados_pillow(caminho_imagem):
    """Carrega metadados usando a biblioteca Pillow."""
    imagem = Image.open(caminho_imagem)
    return imagem.info

def carregar_metadados_exif(caminho_imagem):
    """Carrega metadados EXIF usando a biblioteca exifread."""
    with open(caminho_imagem, "rb") as imagem_arquivo:
        metadados = exifread.process_file(imagem_arquivo)
    return metadados

def extrair_metadados_principais(metadados):
    """Extrai principais metadados de interesse."""
    dados_principais = {
        'Data e Hora': metadados.get('EXIF DateTimeOriginal'),
        'Modelo da Câmera': metadados.get('Image Model'),
        'Fabricante da Câmera': metadados.get('Image Make'),
        'Tempo de Exposição': metadados.get('EXIF ExposureTime'),
        'Abertura': metadados.get('EXIF FNumber'),
        'ISO': metadados.get('EXIF ISOSpeedRatings'),
        'Latitude': None,
        'Longitude': None
    }
    # Extrair localização se disponível
    latitude, longitude = extrair_localizacao(metadados)
    dados_principais['Latitude'] = latitude
    dados_principais['Longitude'] = longitude
    
    return dados_principais

def extrair_localizacao(metadados):
    """Extrai informações de latitude e longitude, se presentes nos metadados."""
    latitude = metadados.get('GPS GPSLatitude')
    longitude = metadados.get('GPS GPSLongitude')
    
    if latitude and longitude:
        latitude = converte_coordenada(latitude)
        longitude = converte_coordenada(longitude)
    
    return latitude, longitude

def converte_coordenada(coord):
    """Converte coordenada GPS de formato EXIF para decimal."""
    graus, minutos, segundos = [float(val.num) / float(val.den) for val in coord.values]
    return graus + (minutos / 60.0) + (segundos / 3600.0)

def salvar_metadados_xlsx(metadados, caminho_saida="metadados_imagens.xlsx"):
    """Salva os metadados em um arquivo Excel (.xlsx)."""
    df = pd.DataFrame(metadados)
    df.to_excel(caminho_saida, index=False, engine='openpyxl')
    print(f"Metadados salvos em {caminho_saida}")

def analisar_imagens_diretorio(diretorio, caminho_saida):
    """Análise completa de metadados para todas as imagens em um diretório."""
    todos_metadados = []
    
    for nome_arquivo in os.listdir(diretorio):
        caminho_imagem = os.path.join(diretorio, nome_arquivo)
        
        if not nome_arquivo.lower().endswith(('.jpg', '.jpeg', '.png')):
            continue  # Ignorar arquivos que não sejam imagens
        
        # Carregar metadados
        metadados_pillow = carregar_metadados_pillow(caminho_imagem)
        metadados_exif = carregar_metadados_exif(caminho_imagem)
        
        # Extrair informações principais
        dados_principais = extrair_metadados_principais(metadados_exif)
        dados_principais["Nome do Arquivo"] = nome_arquivo
        
        # Adicionar metadados à lista
        todos_metadados.append(dados_principais)
    
    # Salvar em XLSX
    salvar_metadados_xlsx(todos_metadados, caminho_saida)

def escolher_diretorio():
    """Seleciona o diretório com as imagens."""
    diretorio = filedialog.askdirectory(title="Selecione o Diretório das Imagens")
    entrada_diretorio.delete(0, tk.END)
    entrada_diretorio.insert(0, diretorio)

def escolher_arquivo_saida():
    """Seleciona o arquivo de saída para salvar o Excel."""
    caminho_arquivo = filedialog.asksaveasfilename(defaultextension=".xlsx", filetypes=[("Excel files", "*.xlsx")], title="Selecione o Diretório e Nome do Arquivo para o Relatório")
    entrada_arquivo.delete(0, tk.END)
    entrada_arquivo.insert(0, caminho_arquivo)

def executar_analise():
    """Executa a análise e salva o relatório."""
    diretorio = entrada_diretorio.get()
    caminho_saida = entrada_arquivo.get()

    if not diretorio or not caminho_saida:
        messagebox.showerror("Erro", "Por favor, selecione ambos os diretórios.")
        return

    try:
        analisar_imagens_diretorio(diretorio, caminho_saida)
        messagebox.showinfo("Sucesso", f"Relatório salvo em {caminho_saida}")
    except Exception as e:
        messagebox.showerror("Erro", f"Ocorreu um erro: {e}")

